import React, { useEffect, useRef, useState } from 'react';
import { QuestionMarkCircleIcon } from '@heroicons/react/24/outline';

const ProblemSection = () => {
    const [isVisible, setIsVisible] = useState(false);
    const sectionRef = useRef(null);

    useEffect(() => {
        const observer = new IntersectionObserver(
            ([entry]) => {
                if (entry.isIntersecting) {
                    setIsVisible(true);
                }
            },
            { threshold: 0.1 }
        );

        if (sectionRef.current) {
            observer.observe(sectionRef.current);
        }

        return () => observer.disconnect();
    }, []);

    const problems = [
        "How can I detach this problem?",
        "How can I improve user engagement?",
        "Which areas of my website are underperforming?",
        "What's causing my page load speed to drop?",
        "Why isn't my traffic converting?",
        "What needs to be optimized first?",
        "How do I track user behavior effectively?",
        "What metrics should I focus on?"
    ];

    return (
        <section className="py-20 bg-white relative overflow-hidden">
            {/* Background Gradient */}
            <div className="absolute inset-0 bg-gradient-to-br from-primary-50/30 to-primary-100/30"></div>

            <div className="container mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
                {/* Header */}
                <div
                    ref={sectionRef}
                    className={`text-center mb-16 transition-all duration-1000 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                        }`}
                >
                    <p className="text-gray-400 text-sm font-medium uppercase tracking-wide mb-4 font-sans">
                        The problem
                    </p>
                    <h2 className="text-3xl sm:text-4xl lg:text-5xl font-display font-semibold text-gray-800 mb-6">
                        Common roadblock to success
                    </h2>
                    <p className="text-lg text-gray-500 max-w-2xl mx-auto font-sans">
                        Running a business comes with endless questions about performance,
                        efficiency, and growth.
                    </p>
                </div>

                {/* Animated Questions Grid */}
                <div className="relative">
                    {/* First Row - Moving Right */}
                    <div className={`flex gap-4 mb-4 transition-all duration-1000 delay-300 ${isVisible ? 'opacity-100' : 'opacity-0'
                        }`}>
                        <div className="flex gap-4 animate-scroll-right">
                            {[...problems.slice(0, 4), ...problems.slice(0, 4)].map((problem, index) => (
                                <div
                                    key={`row1-${index}`}
                                    className={`flex-shrink-0 ${index % 2 === 0 ? 'w-80' : 'w-64'} ${index % 4 === 1 || index % 4 === 2
                                        ? 'bg-white border border-gray-100 shadow-sm'
                                        : 'bg-gray-25'
                                        } rounded-xl p-4 h-24 flex items-center justify-center`}
                                >
                                    {index % 4 === 1 || index % 4 === 2 ? (
                                        <div className="flex items-center gap-3">
                                            <div className="w-8 h-8 bg-primary-50 rounded flex items-center justify-center">
                                                <QuestionMarkCircleIcon className="w-5 h-5 text-primary-500" />
                                            </div>
                                            <p className="text-sm font-medium text-gray-800 text-center font-sans">
                                                {problem}
                                            </p>
                                        </div>
                                    ) : null}
                                </div>
                            ))}
                        </div>
                    </div>

                    {/* Second Row - Moving Left */}
                    <div className={`flex gap-4 transition-all duration-1000 delay-500 ${isVisible ? 'opacity-100' : 'opacity-0'
                        }`}>
                        <div className="flex gap-4 animate-scroll-left">
                            {[...problems.slice(4), ...problems.slice(4)].map((problem, index) => (
                                <div
                                    key={`row2-${index}`}
                                    className={`flex-shrink-0 ${index % 2 === 0 ? 'w-80' : 'w-64'} ${index % 4 === 0 || index % 4 === 2
                                        ? 'bg-white border border-gray-100 shadow-sm'
                                        : 'bg-gray-25'
                                        } rounded-xl p-4 h-24 flex items-center justify-center`}
                                >
                                    {index % 4 === 0 || index % 4 === 2 ? (
                                        <div className="flex items-center gap-3">
                                            <div className="w-8 h-8 bg-primary-50 rounded flex items-center justify-center">
                                                <QuestionMarkCircleIcon className="w-5 h-5 text-primary-500" />
                                            </div>
                                            <p className="text-sm font-medium text-gray-800 text-center font-sans">
                                                {problem}
                                            </p>
                                        </div>
                                    ) : null}
                                </div>
                            ))}
                        </div>
                    </div>
                </div>

                {/* Call to Action */}
                <div className={`text-center mt-16 transition-all duration-1000 delay-700 ${isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-4'
                    }`}>
                    <div className="bg-gradient-to-r from-primary-500 to-primary-400 text-white rounded-2xl p-8 max-w-2xl mx-auto">
                        <h3 className="text-2xl font-display font-semibold mb-4">
                            Stop guessing. Start knowing.
                        </h3>
                        <p className="text-primary-50 mb-6 font-sans">
                            Get clear, actionable insights that answer all your business questions
                            with AI-powered analytics.
                        </p>
                        <button className="bg-white text-primary-500 font-semibold px-6 py-3 rounded-lg hover:bg-gray-25 transition-colors duration-200 font-display">
                            Discover Solutions
                        </button>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default ProblemSection;
